import React, { useState, useEffect } from 'react';
import API_BASE from '../api';

const Explore = ({ setView, setSelectedReceiver }) => {
  const [profiles, setProfiles] = useState([]);
  const [searchSkill, setSearchSkill] = useState('');
  const [message, setMessage] = useState('');

  const fetchProfiles = async (skill = '') => {
    try {
      const url = skill ? `${API_BASE}/profiles/search?skill=${encodeURIComponent(skill)}` : `${API_BASE}/profiles`;
      const response = await fetch(url);
      if (response.ok) {
        const data = await response.json();
        const currentUserId = localStorage.getItem('userId');
        const filtered = data.filter(profile => profile.userId._id !== currentUserId);
        setProfiles(filtered);
      } else {
        setMessage('Error fetching profiles');
      }
    } catch (error) {
      setMessage('Network error');
    }
  };

  useEffect(() => {
    fetchProfiles();
  }, []);

  const handleSearch = () => {
    fetchProfiles(searchSkill);
  };

  return (
    <div className="fade-in">
      <div className="page">
        <div className="profile-card" style={{ textAlign: 'center', marginBottom: '30px', background: 'linear-gradient(135deg, rgba(255,255,255,0.9), rgba(255,255,255,0.95))' }}>
          <h2 style={{ background: 'linear-gradient(135deg, #667eea, #764ba2)', WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent' }}>Explore Profiles</h2>
          <p>Discover new skills and connect with amazing people.</p>
        </div>
        <div className="profile-card">
          <h3>Search by Skills</h3>
          <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap', alignItems: 'center' }}>
            <input
              type="text"
              placeholder="Search by skills"
              value={searchSkill}
              onChange={(e) => setSearchSkill(e.target.value)}
              style={{ flex: 1 }}
            />
            <button onClick={handleSearch}>Search</button>
            <button onClick={() => { setSearchSkill(''); fetchProfiles(); }}>Show All</button>
          </div>
          {message && <p style={{ color: 'red' }}>{message}</p>}
        </div>
      </div>
      <div className="profiles-container" style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(350px, 1fr))', gap: '20px', width: '100%', maxWidth: '1200px' }}>
        {profiles.map((profile) => (
          <div key={profile._id} className="profile-card" style={{ position: 'relative' }}>
            <div style={{ display: 'flex', alignItems: 'center', marginBottom: '15px' }}>
              <div style={{ width: '50px', height: '50px', borderRadius: '50%', background: 'linear-gradient(135deg, #667eea, #764ba2)', color: 'white', display: 'flex', alignItems: 'center', justifyContent: 'center', fontSize: '1.5rem', fontWeight: 'bold', marginRight: '15px' }}>
                {profile.userId.name.charAt(0).toUpperCase()}
              </div>
              <div>
                <h3 style={{ margin: 0 }}>{profile.userId.name}</h3>
                <p style={{ margin: 0, color: '#666' }}>{profile.userId.email}</p>
              </div>
            </div>
            <div style={{ marginBottom: '10px' }}>
              <strong>Skills I can offer:</strong> {profile.skillsOffer.join(', ')}
            </div>
            <div style={{ marginBottom: '10px' }}>
              <strong>Interests:</strong> {profile.interests.join(', ')}
            </div>
            <div style={{ marginBottom: '15px' }}>
              <strong>Skills I want to learn:</strong> {profile.skillsLearn.join(', ')}
            </div>
            <button onClick={() => { setSelectedReceiver({ id: profile.userId._id, name: profile.userId.name }); setView('messages'); }} style={{ width: '100%' }}>Message</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Explore;
